classname=org.tyoda.wurmunlimited.mods.ModelMeImpressed.ModelMeImpressed
classpath=ModelMeImpressed.jar
sharedClassLoader=true

depend.requires=SinduskLibrary

#Level of gm power needed to be able to do the action
gmPowerNeeded=4

#Relog players after their own model changes.
#true: Quickly relogs the player and they'll see their models changed
#false: Only others will see the player's model change, until the player relogs themselves.
relogPlayers=true

#Keep Custom Model In Memory
#true: Just better unless you have changed the models of hundreds of thousands of Items/Creatures
#false: Will cause 1-2sec lags when logging in/teleporting to areas with thousands of Items/Creatures
keepCustomModelInMemory=true



#Your custom models
#If you want to add the Cow(model.creature.quadraped.cow) and the Golden Altar(model.decoration.altar.gold) it should look like this:
#custom_pretty=Cow,Golden Altar
#custom_models=model.creature.quadraped.cow,model.decoration.altar.gold
#The pretty name can be anything you desire, AS LONG AS IT DOES NOT CONTAIN A COMMA! It will be displayed in the model menu
custom_pretty=
custom_models=


